import React from "react";
import "./Nav.css";
function Nav() {
  return (
    <form className="form">
      <div>
        <textarea
          input="text"
          placeholder="Enter the URL in the category selected.."
          className="textarea"
        />
      </div>
      <div>
        <input type="submit" value="save" className="button1" />
      </div>
    </form>
  );
}

export default Nav;
